import { Column, Stack, Card, Box, Columns } from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <Box id='gameBoard' style={{ width: '20%', paddingBottom: '20%' }}>
        <Stack>
          <Columns>
            <Column>
              <Card style={{ width: '20%', paddingBottom: '20%' }}>0,0</Card>
            </Column>
            <Column width='content'>
              <Card>1,0</Card>
            </Column>
            <Column width='content'>
              <Card>2,0</Card>
            </Column>
            <Column width='content'>
              <Card>3,0</Card>
            </Column>
          </Columns>
        </Stack>
      </Box>
    );
  }
}
